def tribonacci(n: int, memo={}):
    """"""
    if n in memo:
        return memo[n]
    elif n == 0:
        return 0
    elif n == 1 or n == 2:
        return 1
    elif n < 0:
        result = tribonacci(n + 3, memo) - tribonacci(n + 2, memo) - tribonacci(n + 1, memo)
    else:
        result = tribonacci(n - 1, memo) + tribonacci(n - 2, memo) + tribonacci(n - 3, memo)
    memo[n] = result
    return result
